import styled from "styled-components";

function Menu() {

    return (
        <Container>
            <Hiperlink onClick={() => navigate("/habitos")}>
            Hábitos </Hiperlink>
            <Hiperlink onClick={() => navigate("/historico")}>
            Histórico </Hiperlink>
        </Container>
    )
}

const Container = styled.div`
    font-family: 'Lexend Deca', sans-serif;
    width: 375px;
    height: 70px;
    display: flex;
    position: fixed;
    bottom: 0;
    left: 0;
    border: 1px solid var(--cor-cinza-borda);
    background-color: #FFFFFF;
`
const Hiperlink = styled.p`
    font-size: 14px;
    color: var(--cor-azul-claro);
`

export default Menu;
